import React from 'react';



const ShopCategory = () => {
  return (
    <div>
      <h2>Наши товары</h2>
      <ul>
        {products.map((product) => (
          <li key={product.id}>
            <h3>{product.name}</h3>
            <p>{product.price}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ShopCategory;
